import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Wrapper = styled.div`
  min-height: 50vh;
`;

function Contact() {
  return (
    <div>
      <Navbar />
      <h3>Contact Page</h3>
      <Footer />
    </div>
  );
}

export default Contact;
